import React from "react";
import "./dist/home.css";
import navBars from "../../data/navBar.json";
import citys from "../../data/city.json"
//===================================
const Header = () => {
  return (
    <div className="header">
      <div className="left">
        <h1>booking website</h1>
      </div>
      <div className="right">
        <button className="btn btn-light">register</button>
        <button className="btn btn-light">login</button>
      </div>
    </div>
  );
};
// export default Header;
//=================================
export const NavBar = () => {
  return (
    <div className="navBar">
      {navBars.map((navbar) => (
        <NavbarItem
          key={Math.random()}
          icon={navbar.icon}
          type={navbar.type}
          active={navbar.active}
        ></NavbarItem>
      ))}
    </div>
  );
};
//==============================
export const NavbarItem = (props) => {
  return (
    <div className={`navBar ${props.active}`}>
      <i className={`fa ${props.icon}`} aria-hidden="true">
        {"  "}
        {props.type}
      </i>
    </div>
  );
};
// export default NavBar;
//============================
const Content = () => {
  return (
    <div className="header-conent">
      <h1> A lifetime of discounts? It's Genius.</h1>
      <p>
        Get rewarded for your travels - unlock instant saving of 10% or more
        with free accont
      </p>
      <div >
        <button className="btn btn-light">Sign in / Register</button>
      </div>
      <div className="late">

            <i className="fa fa-bed"> Where are you going?</i>
            <i className="fa fa-calendar"> 06/24/2022 to 06/24/2022</i>
            <i className="fa fa-male"> 1 auduit - 0 Children - 1 room</i>
            <button >Search</button>

      </div>

    </div>
  );
};
//=============================
const City=(props)=>{
  return(
      <div>
          {
            citys.map(city=>(
                  <RenderCity
                  key={Math.random()}
                  name={city.name}
                  subText={city.subText}
                  image={city.image}
                  ></RenderCity>
              ))
          }
      </div>

  )
};
//===================
const RenderCity=(props)=>{
  return(
      <div>
         <img src={`${props.image}`} alt={`${props.name}`}/>
         <h1>{props.name}</h1>
         <h3>{props.subText}</h3>
      </div>
  )
};
